import logo from './logo.svg';
import './App.css';
import Home from './pages/Home';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/Home",
    element: <Home/>,
  },

  {
    path: "/Register",
    element: <Register/>,
  },

  {
    path: "/Login",
    element: <Login/>,
  },

  {
    path: "/Write",
    element: <Write/>,
  },

  {
    path: "/Single",
    element: <Single/>,
  },
]);

function App() {
  return (
    <div className="App">

      <RouterProvider router={router} />
    </div>
  );
}

export default App;
